import React from 'react';
import axios from 'axios';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import {faEnvelope, faPen, faTrashAlt, faUser, faUserTag} from '@fortawesome/free-solid-svg-icons'
import ModalEditRole from "../components/modal/ModalEditRole";
import ModalDeleteUser from "../components/modal/ModalDeleteUser";
import ModalSignUp from "./modal/ModalSignUp";

export class Users extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            modalSignUpOpen: false,
        };
        this.edit = this.edit.bind(this);
        this.delete = this.delete.bind(this);
        this.handleClickOpenSignUp = this.handleClickOpenSignUp.bind(this);
        this.handleClickCloseSignUp = this.handleClickCloseSignUp.bind(this);
    }

    handleClickOpenSignUp() {
        this.setState({modalSignUpOpen: true});
    };

    handleClickCloseSignUp() {
        this.setState({modalSignUpOpen: false});
    };

    ok(){
        alert('OUI')
    }

    render() {
            return (
                <div className="Users">
                    <button className="button outlined" onClick={this.handleClickOpenSignUp}>Open</button>
                    <ModalSignUp
                        title=" is currently "
                        message="New role : "
                        actionButton="Confirm"
                        closeButton="Quit"
                        open={this.state.modalSignUpOpen}
                        close={this.handleClickCloseSignUp}
                        mainAction={this.ok.bind(this)}
                    />
                </div>
            );

    }
}

export default Users;
